import { motion as Motion } from "framer-motion";
import { useEffect, useState } from "react";

const cards = [
  {
    title: "Rasmalai",
    img: "data:image/jpeg;base64,",
  },
  {
    title: "Gulab Jamun",
    img: "data:image/jpeg;base64,",
  },
  {
    title: "Kaju Katli",
    img: "data:image/jpeg;base64,",
  },
  {
    title: "Laddu",
    img: "data:image/jpeg;base64,",
  },
  {
    title: "Rabri",
    img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQdPkMI_sz_6eicwA9uvG99wpCUgMZXj1-rCQ&s",
  },
];

const HeroCardCarousel = () => {
  const [index, setIndex] = useState(0);

  useEffect(() => {
    const timer = setInterval(() => {
      setIndex((prev) => (prev + 1) % cards.length);
    }, 3500);

    return () => clearInterval(timer);
  }, []);

  const positions = [
    { x: -260, scale: 0.85, opacity: 0.4, z: 1 },
    { x: -130, scale: 0.92, opacity: 0.7, z: 2 },
    { x: 0, scale: 1, opacity: 1, z: 5 }, // CENTER
    { x: 130, scale: 0.92, opacity: 0.7, z: 2 },
    { x: 260, scale: 0.85, opacity: 0.4, z: 1 },
  ];

  return (
    <div className="relative w-full flex justify-center overflow-hidden py-12">
      <div className="relative w-[900px] h-[360px]">
        {cards.map((card, i) => {
          const pos = (i - index + cards.length) % cards.length;
          if (pos > 4) return null;

          const style = positions[pos];

          return (
            <Motion.div
              key={card.title}
              animate={{
                x: style.x,
                scale: style.scale,
                opacity: style.opacity,
                zIndex: style.z,
              }}
              transition={{ duration: 0.9, ease: "easeInOut" }}
              className="absolute left-1/2 -translate-x-1/2 top-0"
            >
              <div className="relative w-[260px] h-[340px] rounded-2xl overflow-hidden shadow-2xl">
                <img
                  src={card.img}
                  alt={card.title}
                  className="w-full h-full object-cover"
                />
                <div className="absolute inset-0 bg-gradient-to-t from-black/60 to-transparent" />
                <h3 className="absolute bottom-6 w-full text-center text-white text-xl font-semibold">
                  {card.title}
                </h3>
              </div>
            </Motion.div>
          );
        })}
      </div>
    </div>
  );
};

export default HeroCardCarousel;
